import React from 'react';
import './Navigation.css';
// import Link from './Link';

const Navigation = () => {
	return (
		<nav className='navigation'>
			<Link text='Product' />
			<Link text='Community' />
			<Link text='Docs' />
			<Link text='Templates' />
			<Link text='Enterprise' />
			<Link text='Try Functions' />
			<Link text='Pricing' />
			<Link text='Login' />
			<Link text='Get started' />
		</nav>
	);
};

const Link = ({ text }) => {
	return <a className='link'>{text}</a>;
};

export default Navigation;
